import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

const rootElement = document.getElementById('root');
const modalElement = document.getElementById('AppointmentPopUpModal');

ReactDOM.render(<App />, rootElement);

function enableScroll() {
  rootElement.style.overflow = 'auto'; // Enable scrolling on the root element
  modalElement.style.overflow = 'hidden'; // Disable scrolling on the AppointmentPopUpModal element
}

function disableScroll() {
  rootElement.style.overflow = 'hidden'; // Disable scrolling on the root element
  modalElement.style.overflow = 'auto'; // Enable scrolling on the AppointmentPopUpModal element
  alert("OMG")
}

export { enableScroll, disableScroll };
